/*************************     DATA REMAPPING/EXTRACTION Functions    ***************************/
function remapData(data, adjust=false) {
    // let jcols = [];
    let jcols = data.columns; // console.log(jcols);
    redata = [];  // reset the placeholder 

    let p = data.index.map((item, index) => {
        // start a row entry
        let row = {};

        if (adjust==true)  // for 1D series with MTF add 16 hrs to adjust 00:00 
            row['time'] = new Date(item * 1000).addHours(16);
            // row['time'] = item;
        else row['time'] = item;// console.log(item);

        jcols.map((col, i) => {
            row[col] = data.data[index][i];   // console.log(jdata.data[index][i]); 
        });
        redata.push(row); // console.log(item, row); 
    })
    // console.log(p)
    return redata;
}

function showDates() {
    basedata.forEach(item => {
        // unix timestamp must be in milli seconds : multiply by 1000
        let p = new Date(1000 * item['time']).toLocaleDateString()
        console.log(p);
    })

}

//  generateSeries(l,'open')[0] // is redundant not 

function generateSeries(data, col) {
    // expects col = 'prop1' (like 'open', 'SQZ')
    // returns multi column array: {time: 1619784000, open: 417.7, close: 417.3}
    return data.map(x => ({ time: x.time, value: x[col] }))
}

