function generateMultiSeries(data, cols) {
    // expects cols = ['prop1', 'prop2']
    // returns multi column array: {time: 1619784000, open: 417.7, close: 417.3}
    return data.map(item => {
        let obj = {};
        obj['time'] = item['time'];
        cols.forEach(col => obj[col] = item[col]);
        return obj;
    });
}

function getSeriesWithColor(data, datacol, colorcol, colormodel) {
    // use color codes with specific cols 'colorcol' with color in dict 'colordict'
    return data.map(item => {
        let obj = {};
        obj['time'] = item['time'];
        obj['value'] = item[datacol];
        obj['color'] = colormodel.colorCode[item[colorcol]];
        return obj;
    })
}

