// add a line series to chart using line config  
function addLineToChart(chartid, lineconfig, data, column) {
    let Line = chartid.addLineSeries(lineconfig);
    Line.setData(generateSeries(data, column));
    return Line;
}

// add a histogram to chart using hist config 
function addHistogramToChart(chartid, histconfig, data, datacolumn, colorcolumn) {
    let histogram = chartid.addHistogramSeries(histconfig);
    if (histconfig.hasCode) {
        histogram.setData(getSeriesWithColor(data, datacolumn, colorcolumn, histconfig));
    } else {
        histogram.setData(generateSeries(data, datacolumn));
    }
    return histogram;
}

